import React from "react";
import { Card } from "react-bootstrap";

function Todo({ todo, index, remove }) {
  function handle() {
    remove(index);
  }
  return (
    <Card>
    <div className="todo" onClick={handle}>
      {todo.text} <div className="bi bi-trash"></div>
    </div>
    </Card>
  );
}
export default Todo;
